import Box from "./Box";

const Row = ({ rowData, rowNum, circle }) => {
  return (
    <div className="row">
      {rowData.map((el, boxNum) => (
        <Box rowNum={rowNum} boxData={el} boxNum={boxNum} circle={circle} />
      ))}
    </div>
  );
};

export default Row;
